import React from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import PopoverPage from "./boot";

const CardsList = (props) => {
  return (
    <div className="style">
      <PopoverPage title={props.title} onClick={props.click} />
      {/* <Card style={{ width: "18rem" }}> */}
      <Card.Img
        variant="top"
        src={`http://image.tmdb.org/t/p/w185/` + props.img}
      />
      <Card.Title></Card.Title>
      {/*  <Card.Body>
          <Card.Title>{props.title}</Card.Title>
          <Card.Title>{props.key}</Card.Title>
          <Card.Text>{props.overview}</Card.Text>
          <Button variant="primary">See Trailer</Button>
        </Card.Body> */}
      {/* </Card> */}
    </div>
  );
};
export default CardsList;
